def is_sorted(lst):
    # Check that the list has at least two elements
    if len(lst) < 2:
        return True

    # Check that the list is sorted in ascending order
    for i in range(len(lst) - 1):
        if lst[i] > lst[i + 1]:
            return False

    # Check that there are no duplicates
    seen = set()
    for num in lst:
        if num in seen:
            return False
        seen.add(num)

    return True

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False
            stack.pop()
    return not stack

def is_equal_to_sum_even(n):
    # Check if n is even
    if n % 2 != 0:
        return False

    # Iterate over all possible combinations of 4 positive even numbers
    for i in range(2, n//2+1):
        for j in range(i, n//2+1):
            for k in range(j, n//2+1):
                for l in range(k, n//2+1):
                    # Check if the sum of the 4 numbers is equal to n
                    if i + j + k + l == n:
                        return True

    # If no combination of 4 even numbers sums to n, return False
    return False

